PREFIX p: <http://www.wikidata.org/prop/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
ASK WHERE {
  wd:Q169452 p:P54 ?s1 .
  ?s1 ps:P54 ?team .
  OPTIONAL {
    ?s1 pq:P580 ?start1 .
  }
  OPTIONAL {
    ?s1 pq:P582 ?end1 .
  }
  wd:Q25369 p:P54 ?s2 .
  ?s2 ps:P54 ?team .
  OPTIONAL {
    ?s2 pq:P580 ?start2 .
  }
  OPTIONAL {
    ?s2 pq:P582 ?end2 .
  }
  FILTER ( ( ! bound( ?start1 ) || ?start1 <= "2000-12-31T23:59:59Z" ^^ xsd:dateTime ) && ( ! bound( ?end1 ) || ?end1 >= "2000-01-01T00:00:00Z" ^^ xsd:dateTime ) && ( ! bound( ?start2 ) || ?start2 <= "2000-12-31T23:59:59Z" ^^ xsd:dateTime ) && ( ! bound( ?end2 ) || ?end2 >= "2000-01-01T00:00:00:00Z" ^^ xsd:dateTime ) )
}

