PREFIX schema: <http://schema.org/>
SELECT ?player ( COUNT( DISTINCT ?award ) AS ?nbAwards ) WHERE {
  VALUES ?player {
    wd:Q41421 wd:Q25369
  }
  ?player wdt:P166 ?award .
  OPTIONAL {
